import React from 'react';

const CustomerForm = () => {
  return (
    <div className="form-container">
      <h2>Thêm mới khách hàng</h2>
      <label>Tên khách hàng</label>
      <input type="text" placeholder="Nhập tên..." />
      <label>Email</label>
      <input type="email" placeholder="Email..." />
      <button>Lưu</button>
    </div>
  );
};

export default CustomerForm;
